import React from "react";
import {
  Header,
  Footer,
  Blog,
  Features,
  Possibility,
  WhatGPT3,
} from "./containers";
import { Brand, CTA, NavBar } from "./components";

const App = () => {
  return (
    <div className="App">
      <div className="gradient__bg">
        <NavBar />
        <Header />
      </div>
      <Brand />
      <WhatGPT3 />
      <Features />
      <Possibility />
      <CTA />
      <Blog />
      <Footer />
    </div>
  );
};

export default App;
